--  DDL for Trigger TRG_BEFORE_INSERT_ORDERS
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "MAINPROJECT"."TRG_BEFORE_INSERT_ORDERS" 
BEFORE INSERT ON orders
FOR EACH ROW
BEGIN
  IF :new.order_id IS NULL THEN
    SELECT order_seq.NEXTVAL
    INTO :new.order_id
    FROM dual;
  END IF;
END;
/
ALTER TRIGGER "MAINPROJECT"."TRG_BEFORE_INSERT_ORDERS" ENABLE;
--------------------------------------------------------
--  DDL for Trigger TRG_BEFORE_INSERT_USERS
--------------------------------------------------------

  CREATE OR REPLACE TRIGGER "MAINPROJECT"."TRG_BEFORE_INSERT_USERS" 
BEFORE INSERT ON USERS
FOR EACH ROW
BEGIN
    IF :NEW.USER_ID IS NULL THEN
        SELECT user_id_seq.NEXTVAL
        INTO :NEW.USER_ID
        FROM dual;
    END IF;
END;



/
ALTER TRIGGER "MAINPROJECT"."TRG_BEFORE_INSERT_USERS" ENABLE;
